import React from 'react';
import './Nav.css';

const Nav = () => {
  return (
    <div className="navbar">
      <div className="navbar-left">
      </div>
      <div className="navbar-right">
        <button className="navbar-button">Add Orders</button>
        <button className="navbar-button">Button 2</button>
      </div>
    </div>
  );
};

export default Nav;
